import React, { Component } from "react";
import "./App.css";

class App extends Component {
  render() {
    return (
      <div>
        <table
          style={{
            background: "linear-gradient(to right ,#778899, #E0FFFF)",
            display: "block",
            color: "#663399",
            fontSize: 24
          }}
        >
          <tbody>
            <tr>
              <td>
                <img width="50" height="50" src="./search.svg" alt="" />
              </td>
              <h2>Movie Digger - The MoviesDB Search</h2>
            </tr>
          </tbody>
        </table>
      </div>
    );
  }
}

export default App;
